import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content';
import {Button} from 'reactstrap';

function HomePage(props) {

    return(
        <div>
            <Hero title={props.title} />

            <Content>
            <p>I am Pranamya Vadlamani, a second-year computer science graduate student at Indiana University, Bloomington. </p>
            <p>With my experience as a software engineer at OpenText for almost two years, I consider myself to be fortunate enough to work on several interesting projects where I could create an impact over several key metric areas such as performance, latency, throughput and overall product experience as well. In this regard, I received accolades from principal architects and senior engineering management for my improvement to the code base to reduce the overall memory footprint.</p>
            <p>As a young girl, I was always immensely fascinated by the gaming industry. With the advancement in technology, it slowly shifted to online and it was a different world altogether. In addition to this, I have always dreamt to work as a computer scientist among the best minds in the Silicon Valley. I believe that interning at a company like Roblox would give me an opportunity to get creative with the game environment. I’m sure it would expose me to the complex engineering challenges behind one of the world’s largest gaming platforms in the most exciting way and help me flex my technical acumen through stretch challenges.
            I’d love to bring my skills and passion to learn new technologies to this position. I am truly excited to start working with you and experience for myself what life at Roblox is all about.</p>


            <Button color="primary">Java</Button>{' '}
            <Button color="danger">JavaScript</Button>{' '}
            <Button color="success">HTML</Button>{' '}
            <Button color="info">CSS</Button>{' '}
            <Button color="warning">Python</Button>{' '}
            </Content>



        </div>
    );
}
export default HomePage;
